#include <stdio.h>
#include <stdlib.h>
#include <stdbool.h>
#include <string.h>

extern long int random(void);
extern void srandom(unsigned int);
extern FILE* popen(const char*, const char*);

bool ParseCommandLine(int argc, char* argv[], const char** generateFile, const char** compareFile, unsigned int* seed, size_t* maxRows, size_t* maxCols);
void Compare(FILE* file, size_t maxRows, size_t maxCols);
void Generate(const char* file, size_t maxRows, size_t maxCols);

extern const char values[];

int main(int argc, char* argv[])
{
	const char *generateFile, *compareFile;
	unsigned int seed;
	size_t maxRows, maxCols;

	if (!ParseCommandLine(argc, argv, &generateFile, &compareFile, &seed, &maxRows, &maxCols))
	{
		printf("usage: get_lost {generate results | compare testcases} maxrows maxcols [-r =random_seed]\n");
		return EXIT_FAILURE;
	}

	srandom(seed);

	if (maxRows == 0 || maxCols == 0)
	{
		printf("Testing %zu by %zu...\n", maxRows, maxCols);
		printf("%s", values);

		return EXIT_FAILURE;
	}

	if (generateFile != NULL)
	{
		FILE* file = fopen(generateFile, "w");

		if (file == NULL)
		{
			printf("could not open file %s", generateFile);
			return EXIT_FAILURE;
		}

		fclose(file);
		Generate(generateFile, maxRows, maxCols);
	}

	else
	{
		FILE* file = fopen(compareFile, "r");

		if (file == NULL)
		{
			printf("could not open file %s\n", compareFile);
			return EXIT_FAILURE;
		}

		Compare(file, maxRows, maxCols);
		fclose(file);
	}

	return EXIT_SUCCESS;
}

bool ParseCommandLine(int argc, char* argv[], const char** generateFile, const char** compareFile, unsigned int* seed, size_t* maxRows, size_t* maxCols)
{
	if (argc <= 4)
		return false;

	*generateFile = NULL;
	*compareFile = NULL;
	*seed = 1;
	*maxRows = 10;
	*maxCols = 10;

	if (strcmp(argv[1], "generate") == 0)
		*generateFile = argv[2];

	else if (strcmp(argv[1], "compare") == 0)
		*compareFile = argv[2];
	else
	{
		printf("the first argument must be \"generate\" or \"compare\"\n");
		return false;
	}

	if (sscanf(argv[3], "%zu", maxRows) != 1)
	{
		printf("the third argument must be a non-negative integer\n");
		return false;
	}

	if (sscanf(argv[4], "%zu", maxCols) != 1)
	{
		printf("the fourth argument must be a non-negative integer\n");
		return false;
	}

	if (argc == 5)
		return true;

	else if (argc != 7)
		return false;

	if (strcmp(argv[5], "-r") != 0)
	{
		printf("unrecognized argument \"%s\"\n", argv[5]);
		return false;
	}

	if (sscanf(argv[6], "%u", seed) != 1)
	{
		printf("the argument for -r must be a non-negative integer");
		return false;
	}

	return true;
}

void Compare(FILE* file, size_t maxRows, size_t maxCols)
{
	for (size_t rows = 1; rows <= maxRows; rows++)
	{
		for (size_t cols = 1; cols <= maxCols; cols++)
		{
			char command[256];
			long int randomNumber = random();
			snprintf(command, sizeof(command), "amaze -c %zu %zu tmp.maze -r %ld -s tmp.maze tmp.maze -d tmp.maze | cksum", rows, cols, randomNumber);
			FILE* output = popen(command, "r");

			char checksum1[30];
			char checksum2[30];
			int bytes1;
			int bytes2;

			fscanf(output, "%30s", checksum1);
			fscanf(file, "%30s", checksum2);
			fscanf(output, "%d", &bytes1);
			fscanf(file, "%d", &bytes2);

			fclose(output);

			if (strcmp(checksum1, checksum2) != 0 || bytes1 != bytes2)
				printf("\"amaze -c %zu %zu tmp.maze -r %ld -s tmp.maze tmp.maze -d tmp.maze\" does not match\n", rows, cols, randomNumber);
		}
	}
}

void Generate(const char* file, size_t maxRows, size_t maxCols)
{
	for (size_t rows = 1; rows <= maxRows; rows++)
	{
		for (size_t cols = 1; cols <= maxCols; cols++)
		{
			char command[256];
			snprintf(command, sizeof(command), "amaze -c %zu %zu tmp.maze -r %ld -s tmp.maze tmp.maze -d tmp.maze | cksum >> %s", rows, cols, random(), file);
			system(command);
		}
	}
}

